g.ns3:text:
\begin{equation*}
 \begin{dcases}
 2^n - 1 + a + e^{i \alpha} \left( a - 1 \right) & n ~\text{even}
 \\
 2^n - 1 + a - e^{i \alpha} \left( a - 1 \right) & n ~\text{odd}
 \end{dcases}
\end{equation*}

\begin{equation*}
 \begin{dcases}
 \frac{1}{2^{n / 2}} \left( 1 + e^{i \alpha} \right) \left( 1 + e^{i \beta} \right) & n ~\text{even}
 \\
 \frac{1}{2^{n / 2}} \Big( \hspace{-1mm} \left( 1 + e^{i \alpha} \right) + e^{i \beta} \left( 1 - e^{i \alpha} \right) \hspace{-1mm} \Big) & n ~\text{odd}
 \end{dcases}
\end{equation*}
